import React from 'react'
import MovieCardList from './MovieCardList'
import styled from 'styled-components'

function PlayingToday() {
  return (
    <div>
        <Wrapper>
            <MovieCardList number={3}/>
        </Wrapper>
        
    </div>
  )
}

const Wrapper=styled.div`
    display: flex;
    outline: solid red;
    margin-top: 3.5rem;
`

export default PlayingToday
